import './style.scss';
import React from "react";
import "antd/dist/antd.css";
import { Col, Button, Row, Input } from 'antd';
import { UploadOutlined } from '@ant-design/icons';

function App() {
  return (
    <Row className="ant-row">
      <Col></Col>
      <Col className='ant-col'>
        <Input placeholder="Nome"/>
        <Button 
        type="primary"
        size="medium"
        icon={<UploadOutlined />}
        >
          Carregar Arquivo
        </Button>
        <Button 
        type='primary'
        size='small'
        icon={<PlusOutlined />}
        ></Button>
      </Col>
    </Row>
  );
}

export default App;
